import { Injectable } from '@angular/core';
import { Package } from 'src/models/package.model';

@Injectable({
  providedIn: 'root'
})
export class PackageService {

  constructor() { }
  public parcels:Package<string>[]=[{
    id:1,
    description:"description",
    recipient: "recipient",
    sender: "sender",
    screen: "",
    title: "title",
    type:"leter",
    department:2
  },
  {
    id:2,
    description:"description",
    recipient: "recipient",
    sender: "sender",
    screen: "",
    title: "title",
    type:"leter",
    department:1
  },
  {
    id:1,
    description:"description",
    recipient: "recipient",
    sender: "sender",
    screen: "",
    title: "title",
    type:"parcel",
    department:2
  }];
  addLeter(id:number): void {
    const lastId = this.parcels[this.parcels.length - 1].id;
    const newId = lastId + 1;
    this.parcels.push({
      id:newId,
      title: `Leter ${newId}`,
      description: 'description',
      sender:`Sender ${newId}`,
      recipient: `Recipient ${newId}`,
      screen:"",
      type:"leter",
      department:id,
    });
    alert("You add new letter to Department "+ id);

  }
  addParcel(id:number): void {
    const lastId = this.parcels[this.parcels.length - 1].id;
    const newId = lastId + 1;
    this.parcels.push({
      id:newId,
      title: `Parcel ${newId}`,
      description: 'description',
      sender:`Sender ${newId}`,
      recipient: `Recipient ${newId}`,
      screen:"",
      type:"leter",
      department:id,
    });
    alert("You add new parcel to Department "+ id);
  }
  remove(id: number): void {
    const deleteIndex = this.parcels.findIndex((pack) => pack.id === id);
    this.parcels.splice(deleteIndex, 1);
    console.log(this.parcels)
  }
}
